import React, { Component } from 'react';

class StudentForm extends Component{
    constructor(){
        super();
        this.state={
            name:'',
            name:'',
            age:'',
            group:'',
            email:'',
            gender:'',
            adress:''
        }
    }
    render(){
        return(
            <div className="card">  
            <div className="card card-header">
               <h5>New Student</h5>
            </div>
            <form className="card card-body">
              <div className="form-group">
                <input className="form-control" placeholder="Name" type="text" />
             </div>
             <div className="form-group">
               <input className="form-control" placeholder="Age" type="text" />
             </div>
             <div className="form-group">
               <input className="form-control" placeholder="Group" type="text" />
             </div>
             <div className="form-group">
               <input className="form-control" placeholder="Email" type="mail" />
             </div>
             <button className="btn btn-block bg-primary text-white "> Add</button>
           </form>
          </div>
        )
    }
    
}
export default StudentForm
